description:
Disraeli Gears is the second album by British supergroup Cream. It was released in November 1967[1] and went on to reach number 5 on the UK Albums Chart.[7] It was also their American breakthrough, becoming a massive seller there in 1968, reaching number 4 on the American charts.[8] The album was #1 for two weeks on the Australian album chart and was listed as the #1 album of 1968 by Cash Box in the year-end album chart in the U.S.[9] The album features the two singles &quot;Strange Brew&quot; and &quot;Sunshine of Your Love&quot;.








